import React, { useState } from "react";
import styled from "styled-components";
import fastFood from "./fastFood";
import "./App.css";
import {
  Switch,
  Route,
  Link,
  useRouteMatch,
  useParams,
} from "react-router-dom";
import Foods from "./Foods";

const App = () => {
  const [data, setData] = useState(fastFood);
  console.log(data);
  return (
    <div className="Main">
      <header>
        {" "}
        <img src="https://saffroncateringonline.co.uk/wp-content/uploads/2020/05/LogoSaffron.png" />
        <p>
          <Link to="/order">Order Pizza</Link>
          <Link to="/">Home</Link>
        </p>
      </header>
      <Foods data={data} />
    </div>
  );
};
export default App;
